// index.js or App.js

import React from 'react';
import ReactDOM from 'react-dom';
import AppRoutes from './Routes';
import App from './App';
import { Routes, BrowserRouter, Route} from 'react-router-dom';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/App" element={ <App /> }>
        </Route>
      </Routes>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
